if ( !step.getWait() || (item instanceof Job && !(item instanceof Queue.Task))) {
    EnvVars envVars = new EnvVars(EnvVars.masterEnvVars);
    envVars.putAll(invokingRun.getEnvironment(listener));
    if (item instanceof Job) {
        envVars.put("JOB_NAME", ((Job) item).getName());
    }
    job = envVars.expand(job);
    item = Jenkins.getActiveInstance().getItem(job, invokingRun.getParent(), Item.class);
    if (item == null) {
        throw new AbortException("No item named " + job + " found");
    }
